DROP TABLE IF EXISTS fee_earning;


CREATE TABLE `fee_earning` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `date` date NOT NULL,
  `user_id` int(11) NOT NULL,
  `file_id` int(11) NOT NULL,
  `file_no` varchar(100) COLLATE latin1_general_ci NOT NULL,
  `amount` decimal(15,2) NOT NULL,
  `ref_no` varchar(100) COLLATE latin1_general_ci NOT NULL,
  `disb_id` bigint(20) NOT NULL,
  `status` varchar(1) COLLATE latin1_general_ci NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `date` (`date`),
  KEY `file_id` (`file_id`),
  KEY `file_no` (`file_no`),
  KEY `user_id` (`user_id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;





DROP TABLE IF EXISTS feedback_campaign;


CREATE TABLE `feedback_campaign` (
  `campaign_id` int(11) NOT NULL AUTO_INCREMENT,
  `campaign_name` varchar(100) COLLATE latin1_general_ci NOT NULL,
  `status` int(11) NOT NULL,
  `campaign_details` varchar(500) COLLATE latin1_general_ci NOT NULL,
  `department_id` int(11) NOT NULL,
  PRIMARY KEY (`campaign_id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;





DROP TABLE IF EXISTS feedback_feedback;


CREATE TABLE `feedback_feedback` (
  `feedback_id` int(11) NOT NULL AUTO_INCREMENT,
  `client` varchar(100) COLLATE latin1_general_ci NOT NULL,
  `question_id` int(11) NOT NULL,
  `dept_id` int(11) NOT NULL,
  `campaign` int(11) NOT NULL,
  `submit_date` text COLLATE latin1_general_ci NOT NULL,
  `subject` varchar(50) COLLATE latin1_general_ci NOT NULL,
  `feedback` varchar(100) COLLATE latin1_general_ci NOT NULL,
  `comments` varchar(700) COLLATE latin1_general_ci NOT NULL,
  `email` varchar(100) COLLATE latin1_general_ci NOT NULL,
  PRIMARY KEY (`feedback_id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;





DROP TABLE IF EXISTS feedback_questions;


CREATE TABLE `feedback_questions` (
  `question_id` int(11) NOT NULL AUTO_INCREMENT,
  `question` varchar(500) COLLATE latin1_general_ci NOT NULL,
  `campaign` int(11) NOT NULL,
  `dept_id` int(11) NOT NULL,
  `status` int(2) NOT NULL,
  PRIMARY KEY (`question_id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;





DROP TABLE IF EXISTS file_action;


CREATE TABLE `file_action` (
  `action_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `inst_id` bigint(20) NOT NULL,
  `action_type` int(11) NOT NULL,
  `client_id` bigint(20) NOT NULL,
  `file_id` bigint(20) NOT NULL,
  `other_file_id` text COLLATE latin1_general_ci NOT NULL,
  `action_date` date NOT NULL,
  `court` varchar(500) COLLATE latin1_general_ci NOT NULL,
  `court_id` int(11) NOT NULL,
  `case_no` varchar(500) COLLATE latin1_general_ci NOT NULL,
  `parties` text COLLATE latin1_general_ci NOT NULL,
  `acting_for` varchar(500) COLLATE latin1_general_ci NOT NULL,
  `opposing_advocate` text COLLATE latin1_general_ci NOT NULL,
  `advocate_in_court` varchar(100) COLLATE latin1_general_ci NOT NULL,
  `coram` text COLLATE latin1_general_ci NOT NULL,
  `instructions` text COLLATE latin1_general_ci NOT NULL,
  `description` text COLLATE latin1_general_ci NOT NULL,
  `nature_of_duty` text COLLATE latin1_general_ci NOT NULL,
  `remarks` text COLLATE latin1_general_ci NOT NULL,
  `next_option` varchar(1) COLLATE latin1_general_ci NOT NULL DEFAULT '2',
  `next_bu_date` date NOT NULL,
  `next_court_date` date NOT NULL,
  `next_action` text COLLATE latin1_general_ci NOT NULL,
  `alert_period` varchar(5) COLLATE latin1_general_ci NOT NULL,
  `billed_in` varchar(1) COLLATE latin1_general_ci NOT NULL DEFAULT '1',
  `fee` decimal(15,2) NOT NULL COMMENT 'minute rate for the person who registered the action',
  `time_hours` varchar(3) COLLATE latin1_general_ci NOT NULL DEFAULT '0',
  `time_minutes` varchar(3) COLLATE latin1_general_ci NOT NULL DEFAULT '0',
  `person_dealing` int(11) NOT NULL,
  `registered_by` int(11) NOT NULL,
  `send_reminder_to` varchar(100) COLLATE latin1_general_ci NOT NULL,
  `status` varchar(1) COLLATE latin1_general_ci NOT NULL,
  `client_portal_status` varchar(1) COLLATE latin1_general_ci NOT NULL DEFAULT '0',
  PRIMARY KEY (`action_id`),
  KEY `action_type` (`action_type`),
  KEY `client_id` (`client_id`),
  KEY `file_id` (`file_id`),
  KEY `action_date` (`action_date`),
  KEY `next_bu_date` (`next_bu_date`),
  KEY `next_court_date` (`next_court_date`),
  KEY `person_dealing` (`person_dealing`),
  KEY `send_reminder_to` (`send_reminder_to`)
) ENGINE=MyISAM AUTO_INCREMENT=70 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;


