) ENGINE=MyISAM DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;





DROP TABLE IF EXISTS hr_competency_assessment_type;


CREATE TABLE `hr_competency_assessment_type` (
  `type_id` int(11) NOT NULL AUTO_INCREMENT,
  `type_name` varchar(500) COLLATE latin1_general_ci NOT NULL,
  `type_status` varchar(1) COLLATE latin1_general_ci NOT NULL DEFAULT '1',
