DROP TABLE IF EXISTS menucat;


CREATE TABLE `menucat` (
  `menu_id` int(11) NOT NULL AUTO_INCREMENT,
  `description` varchar(50) COLLATE latin1_general_ci NOT NULL,
  `mtitle` varchar(50) COLLATE latin1_general_ci NOT NULL,
  `menu_module` varchar(1) COLLATE latin1_general_ci NOT NULL,
  `published` varchar(1) COLLATE latin1_general_ci NOT NULL,
  `comments` longtext COLLATE latin1_general_ci NOT NULL,
  `icofont` varchar(100) COLLATE latin1_general_ci NOT NULL,
  `ordering` float NOT NULL,
  PRIMARY KEY (`menu_id`),
  UNIQUE KEY `menu_id` (`menu_id`)
) ENGINE=MyISAM AUTO_INCREMENT=11 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;





DROP TABLE IF EXISTS menusub;


CREATE TABLE `menusub` (
  `subcat_id` int(11) NOT NULL AUTO_INCREMENT,
  `description` varchar(50) COLLATE latin1_general_ci NOT NULL,
  `menu_id` tinyint(4) NOT NULL,
  `published` varchar(1) COLLATE latin1_general_ci NOT NULL,
  `menu_module` varchar(1) COLLATE latin1_general_ci NOT NULL,
  `menu_status` varchar(1) COLLATE latin1_general_ci NOT NULL DEFAULT '0',
  `ordering` float NOT NULL,
  PRIMARY KEY (`subcat_id`),
  UNIQUE KEY `menu_id` (`subcat_id`)
) ENGINE=MyISAM AUTO_INCREMENT=87 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;





DROP TABLE IF EXISTS menusub2_old;


CREATE TABLE `menusub2_old` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `href1` varchar(100) COLLATE latin1_general_ci NOT NULL,
  `description` varchar(80) COLLATE latin1_general_ci NOT NULL,
  `subcat_id` int(6) NOT NULL,
  `published` varchar(1) COLLATE latin1_general_ci NOT NULL,
  `menu_module` varchar(1) COLLATE latin1_general_ci NOT NULL,
  `accessed_by` varchar(500) COLLATE latin1_general_ci DEFAULT NULL,
  `comments` text COLLATE latin1_general_ci NOT NULL,
  `menu_status` varchar(1) COLLATE latin1_general_ci NOT NULL DEFAULT '0',
  `ordering` float NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=451 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;


