DROP TABLE IF EXISTS phonebook;


CREATE TABLE `phonebook` (
  `pb_id` int(11) NOT NULL AUTO_INCREMENT,
  `model` varchar(255) COLLATE latin1_general_ci NOT NULL,
  `foreign_key` bigint(20) NOT NULL,
  `pb_name` varchar(100) COLLATE latin1_general_ci NOT NULL,
  `pb_company` varchar(200) COLLATE latin1_general_ci NOT NULL,
  `physical_address` text COLLATE latin1_general_ci NOT NULL,
  `pb_title` varchar(100) COLLATE latin1_general_ci NOT NULL,
  `pb_tel_no` varchar(50) COLLATE latin1_general_ci NOT NULL,
  `pb_num` varchar(30) COLLATE latin1_general_ci NOT NULL,
  `pb_email` longtext COLLATE latin1_general_ci NOT NULL,
  `date_reg` date NOT NULL,
  `address` varchar(100) COLLATE latin1_general_ci NOT NULL,
  `p_code` varchar(100) COLLATE latin1_general_ci NOT NULL,
  `p_town` varchar(100) COLLATE latin1_general_ci NOT NULL,
  `created_by` int(11) NOT NULL,
  `created_date` datetime NOT NULL,
  `modified_by` int(11) NOT NULL,
  `modified_date` datetime NOT NULL,
  `status` varchar(1) COLLATE latin1_general_ci NOT NULL DEFAULT '1',
  PRIMARY KEY (`pb_id`),
  KEY `pb_num` (`pb_num`)
) ENGINE=MyISAM AUTO_INCREMENT=25 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;





DROP TABLE IF EXISTS quotation;


CREATE TABLE `quotation` (
  `disb_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `branch` varchar(3) COLLATE latin1_general_ci NOT NULL DEFAULT '02',
  `doc_id` int(11) NOT NULL,
  `client_id` bigint(20) NOT NULL,
  `file_id` bigint(20) NOT NULL,
  `billing_address` text COLLATE latin1_general_ci NOT NULL,
  `bill_to_name` varchar(500) COLLATE latin1_general_ci NOT NULL,
  `bill_to_address` varchar(500) COLLATE latin1_general_ci NOT NULL,
  `bill_to_tel` varchar(500) COLLATE latin1_general_ci NOT NULL,
  `bill_to_email` varchar(500) COLLATE latin1_general_ci NOT NULL,
  `account_of` text COLLATE latin1_general_ci NOT NULL,
  `acc_no_total` varchar(10) COLLATE latin1_general_ci NOT NULL,
  `invoice_no` varchar(10) COLLATE latin1_general_ci NOT NULL,
