INSERT INTO bulk_email_groups VALUES
("1","All Clients","SELECT client.client_id as foreign_key_id, client.comp_email as email1 FROM client WHERE client.status =1 ORDER BY client.client_id","Clients","1"),
("2","All Corporate Clients","SELECT client.client_id as foreign_key_id, client.comp_email as email1 FROM client WHERE client.status =1 AND client.type_id = 1 ORDER BY client.client_id","Clients","1"),
("3","All Individual Clients","SELECT client.client_id as foreign_key_id, client.comp_email as email1 FROM client WHERE client.status =1 AND client.type_id = 2 ORDER BY client.client_id","Clients","1"),
("4","All Customers","SELECT crm_register.customer_id as foreign_key_id, crm_register.comp_email as email1 FROM crm_register WHERE crm_register.status =1 ORDER BY crm_register.customer_id","Customers","0"),
("5","All Suppliers","select client_id as foreign_key_id, comp_email as email1 from supplier where status = 1 ORDER BY client_id","SupplierManagement","1"),
("6","All Staff Members","select user_id as foreign_key_id, email as email1 from users where status = 1 ORDER BY user_id","StaffManagement","1");
